import React from 'react';
import { MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText, MDBCol, MDBContainer, MDBRow } from 'mdbreact';
import portfolios from "./portfolio.json"



const Portfolio = (props) => {
  return (
    <>
      <MDBContainer>
        <MDBRow>
          {portfolios.map(portfolio => (
            <MDBCol sm="6" md="6">
              <MDBCard style={{ width: "25rem", height: "20rem", marginTop: "3em" }}>
                <MDBCardImage className="img-fluid" src={require(`${props.imageSource}`)} waves />
                <MDBCardBody>
                  <MDBCardTitle>{portfolio.name}</MDBCardTitle>
                  <MDBCardText>
                    {portfolio.description}
                  </MDBCardText>
                  <MDBBtn href={portfolios.gihub} target="_blank">Github</MDBBtn>
                  <MDBBtn href={portfolio.url} target="_blank">Demo</MDBBtn>
                </MDBCardBody>
              </MDBCard>
            </MDBCol>
          ))}
        </MDBRow>
      </MDBContainer>
    </>
  )
}

export default Portfolio;
